(6, 2, '\n\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:0pt;\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\nhanging\"><span style=\"font-size:9.0pt;font-family:Amphion;mso-ascii-font-family:\nAmphion;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">\n</span></p>\n\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:0pt;\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\nhanging\"><span style=\"font-size:20.0pt;font-family:Amphion;mso-ascii-font-family:\nAmphion;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#203864;mso-color-index:8;mso-font-kerning:16.0pt;language:en-US\">Background\n</span><span style=\"font-size:20.0pt;font-family:Amphion;mso-ascii-font-family:\nAmphion;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#203864;mso-color-index:8;mso-font-kerning:16.0pt;language:en-US\">of the\nProject</span><span style=\"font-size:12.0pt;font-family:Calibri;mso-ascii-font-family:\nCalibri;mso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:#203864;mso-color-index:8;mso-font-kerning:12.0pt;language:en-US\">\n</span></p>\n\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\ntext-align:justify;text-justify:inter-ideograph;direction:ltr;unicode-bidi:\nembed;mso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:14.0pt;font-family:Amphion;mso-ascii-font-family:Amphion;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">&nbsp;</span><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:\n&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;color:black;mso-color-index:1;mso-font-kerning:16.0pt;\nlanguage:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span>G</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">overnment\nofficers are entitled to receive a piece of land for giving their life time\nservice to the nation with devotion. Bangladesh Army solved the accommodation\nproblem of the officers through DOHS in and around cantonments. But it has\nbecome difficult for the authority to accommodate more number of officers in\nDOHS as acquisition of land becoming a challenge for the Government due to\npopulation increase and changed socio-cultural scenario. Considering the fact,\nBangladesh Army has taken a step to build a township with the approval of\nHonorable Prime Minister Sheikh Hasina from 23 Nov 2009. The project named\nJolshiri Abashon is implementing by Bangladesh Army in between River BALU &amp;\nRiver SHITALAKKHYA covering 2103 acres of land for Defense Officers Housing. </span><span style=\"font-size:14.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">\n</span></p>\n\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\ntext-align:justify;text-justify:inter-ideograph;direction:ltr;unicode-bidi:\nembed;mso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:28.0pt;font-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:\n&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;color:black;mso-color-index:1;mso-font-kerning:16.0pt;\nlanguage:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span>J</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">olshiri </span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">Abashon\nwas initially planned to be self-financed based. But as the officers are\nreceiving a plot instead of DOHS, considering the fact cost of city development\nis providing by authority. The fundings are based on loan and other sources\nfrom Government/Non-government/foreign entrepreneurs which is returnable.</span><span style=\"font-size:14.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">\n</span></p>\n\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\ntext-align:justify;text-justify:inter-ideograph;direction:ltr;unicode-bidi:\nembed;mso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span><span style=\"mso-spacerun:yes\">&nbsp;</span></span><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:\n&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;color:black;mso-color-index:1;mso-font-kerning:16.0pt;\nlanguage:en-US\">A</span><span style=\"font-size:14.0pt;font-family:CastleTLig;\nmso-ascii-font-family:CastleTLig;mso-fareast-font-family:&quot;MS Mincho&quot;;\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:black;mso-color-index:1;\nmso-font-kerning:16.0pt;language:en-US\">uthority has been redesigned the\nmodalities and planned to build a self-sustainable city near Dhaka city where\nfuture diplomatic zone is likely to shift.<span style=\"mso-tab-count:1\">&nbsp; </span></span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">\n</span></p>\n\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\ntext-align:justify;text-justify:inter-ideograph;direction:ltr;unicode-bidi:\nembed;mso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:\n&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:\n&quot;Times New Roman&quot;;color:black;mso-color-index:1;mso-font-kerning:16.0pt;\nlanguage:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span>T</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">he </span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\nmso-fareast-font-family:&quot;MS Mincho&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:16.0pt;language:en-US\">project\nhas been formally inaugurated on 10 Feb 2015. As per the implementation plan\nfor the project development work, Bangladesh Army is committed to complete the\ninitial stage by 2018, build up stage by 2022 and completion stage by 2025.</span><span style=\"font-size:14.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">\n</span></p>\n\n', '2016-08-10 12:11:29'),
(7, 1, '\r\n\r\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:0pt;margin-left:0in;\r\ntext-align:left;direction:ltr;unicode-bidi:embed;mso-line-break-override:none;\r\nword-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:24.0pt;\r\nfont-family:Calibri;mso-ascii-font-family:Calibri;mso-fareast-font-family:+mn-ea;\r\nmso-bidi-font-family:+mn-cs;color:black;mso-font-kerning:12.0pt;language:en-US\">About\r\nUs</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;\r\nmso-ascii-font-family:&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;\r\nlanguage:en-US;font-weight:bold\">J</span><span style=\"font-size:12.0pt;\r\nfont-family:CastleTLig;mso-ascii-font-family:CastleTLig;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;color:black;\r\nmso-font-kerning:12.0pt;language:en-US;font-weight:bold\">olshiri Abashon</span><span style=\"font-size:12.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-font-kerning:12.0pt;language:en-US\"> a company registered with\r\nThe Joint Stock Companies under the Company Act of 1994 Section-28(KA)-is owned\r\nand managed by Bangladesh Army. It is run by a Board of Directors drawn from\r\nthe top brass of Bangladesh Army and headed by a Chairman in the rank of Major\r\nGeneral. Unlike existing DOHSs (Defense Officers Housing Societies) of\r\ncomparatively smaller sizes, it is a massive endeavor, an ideal and independent\r\nsatellite township development undertaking, the first of its kind in the\r\ncountry by Bangladesh Army. It is very close to the capital city with excellent\r\nconnectivity and all the modern amenities, facilities and much more.</span><span style=\"font-size:10.5pt;font-family:Calibri;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:20.0pt;font-family:&quot;Amethyst Lite Italic&quot;;\r\nmso-ascii-font-family:&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;\r\nlanguage:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span></span><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:\r\n&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;language:en-US\">T</span><span style=\"font-size:12.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-font-kerning:12.0pt;language:en-US\">he well-conceived\r\ndevelopment endeavor has plans to blend human habitats with earth and its\r\npristine environment that also rationally adds aesthetics, amusement and\r\nrecreation together essentially with all the urban functionalities, for a\r\ncomfortable and enjoyable life for people of all ages in a full-fledged and\r\nindependent modern city.</span><span style=\"font-size:10.5pt;font-family:Calibri;\r\nmso-ascii-font-family:Calibri;mso-fareast-font-family:Calibri;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:24.0pt;font-family:&quot;Amethyst Lite Italic&quot;;\r\nmso-ascii-font-family:&quot;Amethyst Lite Italic&quot;;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;\r\nlanguage:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span>T</span><span style=\"font-size:12.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-font-kerning:12.0pt;language:en-US\">he facilities include\r\nadequate and appropriate thoroughfares. Pedestrians. Walkways lakes and\r\ncommunity facilities, play lots and playground, health &amp; sports and\r\namusement facilities, neighborhood, shopping corners and a central business\r\ndistrict (CBD) as a commercial and trading hub enriching the modern day\r\ntownship. And to take total care of the hygiene aspect as well as ensure a\r\nhealthy environment, a solid waste management system, a sewerage treatment\r\nplant and a water treatment plant have also been added to make it a green and\r\nstandalone urban setup. </span><span style=\"font-size:10.5pt;font-family:Calibri;\r\nmso-ascii-font-family:Calibri;mso-fareast-font-family:Calibri;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:12.0pt;font-family:CastleTLig;mso-ascii-font-family:\r\nCastleTLig;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-font-kerning:12.0pt;language:en-US\">The national space standard\r\nfor urban community facilities spelled in Private Housing Project Land\r\nDevelopment Rules (PHPLDR) 2004(updated 2012), has been strictly followed in\r\nthe planning process. </span><span style=\"font-size:12.0pt;font-family:Calibri;\r\nmso-ascii-font-family:Calibri;mso-fareast-font-family:+mn-ea;mso-bidi-font-family:\r\n+mn-cs;color:black;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n', '2016-08-10 12:33:01');
