ment project on 6374 Bigha (2103.30 acre) of land at </span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">Rupganj</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\"> </span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">Upazila</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\"> of </span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">Narayangonj</span><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\"> District\r\nwith all infrastructural facilities of a model town. The Project is primarily\r\nplanned to accommodate around 6400 officers in order to solve the housing\r\nproblem of Army officers of Bangladesh Army. The project is not a profitable\r\nproject. Though limited number of high rise apartment blocks, commercial plots,\r\nclinic, etc. will be sold in order to recover the project cost.</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:\r\nCastleTLig;mso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n<p style=\"language:en-US;line-height:115%;margin-top:0pt;margin-bottom:10.0pt;\r\nmargin-left:0in;text-align:justify;text-justify:inter-ideograph;direction:ltr;\r\nunicode-bidi:embed;mso-line-break-override:none;word-break:normal;punctuation-wrap:\r\nhanging\"><span style=\"font-size:32.0pt;font-family:Amphion;mso-ascii-font-family:\r\nAmphion;mso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#203864;mso-color-index:8;mso-font-kerning:12.0pt;language:en-US\">Values</span><span style=\"font-size:32.0pt;font-family:Calibri;mso-ascii-font-family:Calibri;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:#203864;mso-color-index:8;mso-font-kerning:12.0pt;language:en-US\">\r\n</span></p>\r\n\r\n<p style=\"language:en-US;margin-top:0pt;margin-bottom:12.0pt;margin-left:0in;\r\ntext-align:justify;text-justify:inter-ideograph;direction:ltr;unicode-bidi:\r\nembed;mso-line-break-override:none;word-break:normal;punctuation-wrap:hanging\"><span style=\"font-size:14.0pt;font-family:CastleTLig;mso-ascii-font-family:CastleTLig;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-index:1;mso-font-kerning:12.0pt;language:en-US\"><span style=\"mso-tab-count:1\">&nbsp; </span></span><span style=\"font-size:24.0pt;\r\nfont-family:&quot;Amethyst Lite Italic&quot;;mso-ascii-font-family:&quot;Amethyst Lit